import { useEffect, useState } from "react";

function DriverLoads({ driverName, id }) {
  const [driverLoads, setDriverLoads] = useState([])

  useEffect(() => {
    fetch(`http://localhost:9292/Drivers/${id}/Loads`)
    .then(r => r.json())
    .then(loadsData => {
      setLoads(loadsData)
      console.log(loadsData)
    })
  }, [])



  return (
    <div className="card">
    <h1>Loads of</h1>
    </div>
  )
}

export default DriverLoads;
